	// timeline functions:
	this.frame_0 = function() {
		this.stop();
		
		this.btn_start.addEventListener("click", start_animation.bind(this));
					
					function start_animation(){
						this.gotoAndPlay(1);
					}
	}
	this.frame_1 = function() {
		//this.stop();
		var that = this;
		
		this.male1.visible = true;
		this.male2.visible = true;
		
		this.female.movement.purple.visible = false;
		this.male1.movement.green.visible = false;
		this.male2.movement.green.visible = false;
	}
	this.frame_28 = function() {
		this.female.movement.purple.visible = false;
	}
	this.frame_148 = function() {
		this.male1.movement.green.visible = false;
		//this.male2.movement.green.visible = true;
		this.female.movement.purple.visible = true;
	}
	this.frame_163 = function() {
		this.female.movement.purple.visible = true;
		//this.male2.movement.green.visible = true;
	}
	this.frame_198 = function() {
		this.female.movement.purple.visible = false;
	}
	this.frame_276 = function() {
		var that = this;
		
		this.male2.movement.green.visible = false;
		this.female.movement.purple.visible = true;
		
		setTimeout(Occluder, 13000);
				
				function Occluder(){
					that.gotoAndStop(0);
				}
	}
	this.frame_303 = function() {
		this.female.movement.purple.visible = false;
	}
	this.frame_414 = function() {
		this.female.movement.purple.visible = true;
	}
	this.frame_477 = function() {
		this.female.movement.purple.visible = false;
	}

	// actions tween:
	this.timeline.addTween(cjs.Tween.get(this).call(this.frame_0).wait(1).call(this.frame_1).wait(27).call(this.frame_28).wait(120).call(this.frame_148).wait(15).call(this.frame_163).wait(35).call(this.frame_198).wait(78).call(this.frame_276).wait(27).call(this.frame_303).wait(111).call(this.frame_414).wait(63).call(this.frame_477).wait(23));

